import React, { useEffect, useState } from "react";
import "./Components.css";
import Course from "./Course.js";
import axios from "axios";

class CourseTable extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      courses: [],
    };
  }

  componentDidMount() {
    axios.get("http://localhost:5000/courses").then((res) => {
      const courses = res.data;
      this.setState({ courses });
    });
  }

  renderCourses() {
    var period = 1;
    var semester = 7;
    var area = "";
    var renderedCourses = [];
    do {
      renderedCourses.push(
        <div className={"period:" + period}>
          <h2>Termin {semester}</h2>
          <h3>Period {period}</h3>
          <h3>Area {area}</h3>
          <table className="table table-sm">
            <tr>
              <tbody>
                <p>Paragrafus</p>
              </tbody>
            </tr>
          </table>
        </div>
      );
      semester++;
    } while (semester <= 10);
    return <div>{renderedCourses}</div>;
  }

  render() {
    var table_test = this.renderCourses();
    return (
      <div>
        <p>{table_test}</p>
        <table className="table table-sm">
          <thead>
            <tr>
              <th scope="col">Check</th>
              <th scope="col">Kurskod</th>
              <th scope="col">Kurs</th>
              <th scope="col">Hp</th>
              <th scope="col">Niv√•</th>
              <th scope="col">Block</th>
              <th scope="col">VOF</th>
              <th scope="col">TEN</th>
              <th scope="col">LAB</th>
              <th scope="col">PRA</th>
              <th scope="col">UPG</th>
              <th scope="col">KTR</th>
              <th scope="col">HEM</th>
              <th scope="col">BAS</th>
            </tr>
          </thead>
        </table>
      </div>
    );
  }
}

export default CourseTable;
